import React from 'react'
import { Card } from 'antd'

const { Meta } = Card

const Home = () => {
    return (
        <div className='container'>
            <div className='suggested'>Suggested for you</div>
            <div className='card-container'>
                <Card
                    hoverable
                    style={{
                        width: 300,
                    }}
                    cover={<img alt='example' src='https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png' />}
                >
                    <Meta title='Waffles' description='https://thebelgianwaffle.co' />
                </Card>
                <Card
                    hoverable
                    style={{
                        width: 300,
                    }}
                    cover={<img alt='example' src='https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png' />}
                >
                    <Meta title='Cake' description='https://www.monginis.net' />
                </Card>
                <Card
                    hoverable
                    style={{
                        width: 300,
                    }}
                    cover={<img alt='example' src='https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png' />}
                >
                    <Meta title='Burger' description='https://www.burgerking.in' />
                </Card>
            </div>
            <div className='card-container'>
                <Card
                    hoverable
                    style={{
                        width: 300,
                    }}
                    cover={<img alt='example' src='https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png' />}
                >
                    <Meta title='Sandwitch' description='https://balajisandwitch.com' />
                </Card>
                <Card
                    hoverable
                    style={{
                        width: 300,
                    }}
                    cover={<img alt='example' src='https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png' />}
                >
                    <Meta title='Biryani' description='https://www.behrouzbiryani.com' />
                </Card>
                <Card
                    hoverable
                    style={{
                        width: 300,
                    }}
                    cover={<img alt='example' src='https://os.alipayobjects.com/rmsportal/QBnOOoLaAfKPirc.png' />}
                >
                    <Meta title='Chicken' description='https://online.kfc.co.in' />
                </Card>
            </div>
        </div>
    )
}

export default Home
